head.script:

	scwin.onpageload = function() {
    // grp-add-box 안에 add-box가 없으면
            function addBoxVisibility(){
                $(".grp-add-box").each(function() {
                    const wrapAddBox = $(this);
                    const addBox = wrapAddBox.find(".add-box");

                    if (addBox.length === 0) {
                        wrapAddBox.remove();
                    }
                });
            };
    //round-table-box 안에 data가 없으면
            function tableVisibility(){
                 $(".round-table-box").each(function() {
                const wrapTableBox = $(this);
                const dataRow = wrapTableBox.find(".w2tb_td");

                if(dataRow.length === 0){
                    wrapTableBox.find('.tb').remove();
                    wrapTableBox.find('.nodata').show();
                }
                });
            };
	//upload-form-box 안에 data가 없으면
            function uploadVisibility(){
                 $(".upload-form-box").each(function() {
                const uploadBox = $(this);
                const dataRow = uploadBox.find(".w2tb_td");

                if(dataRow.length === 0){
                    uploadBox.find('.table-box').remove();
                    uploadBox.find('.notice').show();
                }
                });
            };
     // add-box 삭제       
			function deleteBtn() {
                    const $btn = $('.btn-delete');

                    $btn.on('click', function(){
                        if($(this).closest('.add-box')){
                            $(this).closest('.add-box').remove();
                        } 
                        if($(this).closest('table')){
                            $(this).closest('tr').remove();
                        }
                        addBoxVisibility();
                        tableVisibility();
						uploadVisibility();
                    });
			};

		//검색영역 확장축소
			function searchListExpand(){
				const btnExp = $('.btn-expand');

				btnExp.on('click', function(){
					const searchBox = $(this).closest('.search-box');
					const currentVal = $(this).val();

					if(searchBox.hasClass('expand')){
						searchBox.removeClass('expand');
					} else {
						searchBox.addClass('expand');
					}
					if(currentVal === "열기"){
						$(this).val("닫기");
					} else {
						$(this).val("열기");
					}
        		});
    		};
            //버튼 있는 tab
            function tabBtn(){
                const buttonBox = $('<li class="tab-control-box w2tabcontrol_li"></li>');

                const tabAddBtn = $('<a href role="button" id="addTabLi" class="btn-dotline">추가하기</a>');
                const tabCopyPaste = $('<a href role="button" class="btn-dotline">복사 추가하기</a>');

                buttonBox.append(tabAddBtn);
                buttonBox.append(tabCopyPaste);

                $('.w2tabcontrol_tabhost').append(buttonBox);
            }
    //툴팁
            function tooltipOn(){
                const btnTooltipOn = $('.btn-tooltip');
                const btnToolTipOff = btnTooltipOn.next().find('.btn-closed');

                btnTooltipOn.on('click',function(){
                    $(this).next().fadeIn();
                });
                btnToolTipOff.on('click', function(){
                    $(this).closest('.balloon').fadeOut();
                });

            }


            addBoxVisibility();
            tableVisibility();
			uploadVisibility();
            deleteBtn(); 
    		searchListExpand();
            tooltipOn();
            tabBtn();
	};

	scwin.onpageunload = function() {

	};
	var popupS = {
    id : "popupS",
    type : "wframePopup",
    popupName : "팝업S-W500",
    modal : "true",
	width:"500px"
	}; 
	$p.openPopup("popup1.xml", popupS);

	var popupM = {
    id : "popupM",
    type : "wframePopup",
    popupName : "팝업M-W800",
    modal : "true",
	width:"800px"
	}; 
	$p.openPopup("popup1.xml", popupM);


	var popupL = {
    id : "popupL",
    type : "wframePopup",
    popupName : "팝업L-W1000",
    modal : "true",
	width:"1000px"
	}; 
	$p.openPopup("popup1.xml", popupL);



	scwin.popupS_onclick = function(e) {
		$p.openPopup("popup1.xml", popupS);
	};

	scwin.popupM_onclick = function(e) {
		$p.openPopup("popup1.xml", popupM);
	};

	scwin.popupL_onclick = function(e) {
		$p.openPopup("popup1.xml", popupL);
	};

function popAlert(obj){
    if(!obj.type || !obj.msg) return;
    var rowJSON = obj;
    var dataObject = {
        "type" : "json", // 데이터 타입. "json" 권장 
        "name" : "alertParam",  // 데이터를 가져오기 위한 key 값. popup에서 $p.getParameter( "alertParam" )로 깨내올 수 있음.
        "data" : rowJSON // 실제 전달할 데이터
    };

    var alertOpt = {
        id : "popAlert",
        type : "wframePopup",
        className : "pop-alert",
        popupName : "alert",
        modal : "true",
        width:"280px",
        dataObject : dataObject
    }; 
    $p.openPopup("alert.xml", alertOpt);
}

scwin.alertBtn_onclick = function(e) {
    popAlert({ 
        "type": "alert",
        "msg": "얼럿 메시지 입니다 1111",
        "ok": function(){
            console.log("완료!!");
        }
    });
}; 
scwin.confirmBtn_onclick = function(e) {
    popAlert({ 
        "type": "confirm",
        "msg": "컨펌 메시지 입니다 222",
        "okTxt": "예",
        "cancelTxt": "아니오",
        "ok": function(){
            console.log("예!! 예!! 예!!");
        },
        "cancel": function(){
            console.log("아니오!!! 아니오!!!");
        }
    });
};

